%[text] ## FIRST ORDER APROXIMATION

alpha = 0.13; %[control:slider:5942]{"position":[9,13]}
beta = 0; %[control:slider:940d]{"position":[8,9]}
wc =1.01; %[control:slider:8224]{"position":[5,9]}

w = logspace(-2, 2, 1000);  % Frequency range (0.01 to 100 rad/s)
s_vals = 1j * w;           % s = jω for frequency response

% s_apox =  (s+ζ) / (s*ζ + 1)
function S_FOA = FOA(S, alpha, wc)
    Zeta=tan(alpha*pi/2)+sec(alpha*pi/2);
    S_FOA = (S .* Zeta ./ wc + 1) ./ (S ./ wc + Zeta) ;
end
    

% H(s) = (s+z) / (s*z + 1) ~= 1/s^(α) = s^(-α)
H_vals = 1 ./ FOA(s_vals, alpha, wc);

% Convert to magnitude (dB) and phase (degrees)
magnitude_db = 20 * log10(abs(H_vals));
phase_deg = angle(H_vals) * 180/pi;

% Create Bode plot
figure(2);
subplot(2,1,1); %[output:7146d49e]
semilogx(w, magnitude_db); %[output:7146d49e]
grid on; %[output:7146d49e]
ylabel('Magnitude (dB)'); %[output:7146d49e]
title(sprintf('FOA Fractional-Order System: H(s) = s^{%.2f}', exponent)); %[output:7146d49e]

subplot(2,1,2); %[output:7146d49e]
semilogx(w, phase_deg); %[output:7146d49e]
grid on; %[output:7146d49e]
ylabel('Phase (degrees)'); %[output:7146d49e]
% xlabel('Frequency (rad/s)');

%%
%[text] ## SECOND ORDER APROX
alpha = 0.5; %[control:slider:3333]{"position":[9,12]}
beta = 0; %[control:slider:0eb1]{"position":[8,9]}
wc =1.01; %[control:slider:9595]{"position":[5,9]}
w = logspace(-2, 2, 1000);  % Frequency range (0.01 to 100 rad/s)
s_vals = 1j * w;           % s = jω for frequency response


% s = 
function S_SOA = SOA(S, alpha, wc)
    aprox_var_0 = alpha^alpha + 2.*alpha + 1;
    aprox_var_2 = alpha^alpha - 2.*alpha + 1;
    aprox_var_1 = (aprox_var_2 - aprox_var_0) .* tan((2 + alpha) .* pi./4);
    S_center = S ./ wc;
    S_SOA = (aprox_var_0 .* S_center .^2 + aprox_var_1 .* S_center + aprox_var_2)./(aprox_var_2 .* S_center .^2 + aprox_var_1 .* S_center + aprox_var_0);
end

% H(s) = (a_2 * s^2 + a_1 * s + a_0) / a_0 * S^2 + a_1 * S + a_0) ~= 1/s^(α) = s^(-α)
exponent = -(alpha + beta*1j);
H_vals = 1 ./ SOA(s_vals, alpha, wc);

% Convert to magnitude (dB) and phase (degrees)
magnitude_db = 20 * log10(abs(H_vals));
phase_deg = angle(H_vals) * 180/pi;

% Create Bode plot
figure(2);
subplot(2,1,1); %[output:359573e5]
semilogx(w, magnitude_db); %[output:359573e5]
grid on; %[output:359573e5]
ylabel('Magnitude (dB)'); %[output:359573e5]
title(sprintf('SOA Fractional-Order System: H(s) = s^{%.2f}', exponent)); %[output:359573e5]

