%%
%[text] ## Error Calc (1% error bandwidth)
alpha = 0.5; %[control:slider:610a]{"position":[9,12]}
beta = 0; %[control:slider:5886]{"position":[8,9]}
w = logspace(-2, 2, 1000);  
wc_values = logspace(-2, 2, 1000);
s_vals = 1j * w;

exponent = -(alpha + beta*1j);

foa_band_low = nan(size(wc_values));
foa_band_high = nan(size(wc_values));
foa_bandwidth = nan(size(wc_values));
foa_ratio = nan(size(wc_values));

soa_band_low = nan(size(wc_values));
soa_band_high = nan(size(wc_values));
soa_bandwidth = nan(size(wc_values));
soa_ratio = nan(size(wc_values));

for idx = 1:numel(wc_values)
    current_wc = wc_values(idx);

    H_frac = (s_vals ./ current_wc).^exponent;
    H_fo = 1 ./ FOA(s_vals, alpha, current_wc);
    H_so = 1 ./ SOA(s_vals, alpha, current_wc);

    rel_err_fo = abs(H_fo ./ H_frac - 1);
    rel_err_so = abs(H_so ./ H_frac - 1);

    [~, center_idx] = min(abs(log10(w) - log10(current_wc)));

    if rel_err_fo(center_idx) <= 0.01
        low_idx = center_idx;
        while low_idx > 1 && rel_err_fo(low_idx - 1) <= 0.01
            low_idx = low_idx - 1;
        end
        high_idx = center_idx;
        while high_idx < numel(w) && rel_err_fo(high_idx + 1) <= 0.01
            high_idx = high_idx + 1;
        end
        foa_band_low(idx) = w(low_idx);
        foa_band_high(idx) = w(high_idx);
        foa_bandwidth(idx) = foa_band_high(idx) - foa_band_low(idx);
        foa_ratio(idx) = foa_band_high(idx) ./ foa_band_low(idx);
    end

    if rel_err_so(center_idx) <= 0.01
        low_idx = center_idx;
        while low_idx > 1 && rel_err_so(low_idx - 1) <= 0.01
            low_idx = low_idx - 1;
        end
        high_idx = center_idx;
        while high_idx < numel(w) && rel_err_so(high_idx + 1) <= 0.01
            high_idx = high_idx + 1;
        end
        soa_band_low(idx) = w(low_idx);
        soa_band_high(idx) = w(high_idx);
        soa_bandwidth(idx) = soa_band_high(idx) - soa_band_low(idx);
        soa_ratio(idx) = soa_band_high(idx) ./ soa_band_low(idx);
    end
end

bandwidthResults = table(wc_values(:), foa_band_low(:), foa_band_high(:), foa_bandwidth(:), foa_ratio(:), ...
                         soa_band_low(:), soa_band_high(:), soa_bandwidth(:), soa_ratio(:), ...
                         'VariableNames', {'wc', 'foaLow', 'foaHigh', 'foaBandwidth', 'foaRatio', ...
                                           'soaLow', 'soaHigh', 'soaBandwidth', 'soaRatio'});

disp('Stored 1% error bandwidth results in table ''bandwidthResults''.'); %[output:3b2d0f5e]
disp('Preview of first 10 center frequencies:'); %[output:8b452457]
disp(bandwidthResults(1:10, :)); %[output:3f614527]



%%
%[text] ## PLL Simulation with Three Filter Types
clear; clc;

%% Filter Design Parameters
alpha = 0.5; %[control:slider:397f]{"position":[9,12]}
beta = 0; %[control:slider:89b0]{"position":[8,9]}
wc =1.01; %[control:slider:6aa6]{"position":[5,9]}

%% Simulation Parameters
fs = 10000;
dt = 1/fs;
t = 0:dt:1;

%% Input signal parameters
f_input = 100;   
SNR_dB = 10;

% input signal with noise
input_signal = sin(2*pi*f_input*t);
noise = randn(size(t));
noise_power = var(input_signal) / (10^(SNR_dB/10));
noise = noise * sqrt(noise_power);
noisy_input = input_signal + noise;

%% PLL Parameters
Kd = 1;
Kv = 50;
f_vco_free = 95;

%% Create Transfer Functions for Each Filter

% Filter 1: Fractional Order (Ideal)
exponent = -(alpha + beta*1j);
w_design = logspace(-2, 2, 1000);
s_design = 1j * w_design;
H_fractional = (s_design./wc).^exponent;

% Filter 2: First Order Approximation (FO)
aprox_var = tan(alpha*pi/2) + sec(alpha*pi/2);
s_design_new_FO = (s_design .* aprox_var ./ wc + 1) ./ (s_design ./ wc + aprox_var);
H_FO = 1 ./ s_design_new_FO;

% Filter 3: Second Order Approximation (SO)
aprox_var_0 = alpha^alpha + 2.*alpha + 1;
aprox_var_2 = alpha^alpha - 2.*alpha + 1;
aprox_var_1 = (aprox_var_2 - aprox_var_0) .* tan((2 + alpha) .* pi./4);
s_design_center = s_design ./ wc;
s_design_new_SO = (aprox_var_0 .* s_design_center.^2 + aprox_var_1 .* s_design_center + aprox_var_2)./(aprox_var_2 .* s_design_center.^2 + aprox_var_1 .* s_design_center + aprox_var_0);
H_SO = 1 ./ s_design_new_SO;

%% Convert Filters to Rational Transfer Functions for Simulation

% For FO approximation: H(s) = (s/wc + aprox_var) / (s*aprox_var/wc + 1)
num_FO = [1/wc, aprox_var];
den_FO = [aprox_var/wc, 1];

% For SO approximation
num_SO = [aprox_var_2/wc^2, aprox_var_1/wc, aprox_var_0];
den_SO = [aprox_var_0/wc^2, aprox_var_1/wc, aprox_var_2];

% Convert to discrete time using bilinear transformation
[num_FO_z, den_FO_z] = bilinear(num_FO, den_FO, fs);
[num_SO_z, den_SO_z] = bilinear(num_SO, den_SO, fs);

% Display filters
fprintf('First Order Approximation H(s):\n'); %[output:2c3b420c]
H_FO_tf = tf(num_FO, den_FO);
disp(H_FO_tf); %[output:82768299]

fprintf('\nSecond Order Approximation H(s):\n'); %[output:2f6aad2f]
H_SO_tf = tf(num_SO, den_SO);
disp(H_SO_tf); %[output:79e503fc]

%% Plot Bode Diagrams
figure('Position', [100, 100, 1200, 500]); %[output:27b4e498]

% Calculate magnitude and phase
magnitude_db_fractional = 20 * log10(abs(H_fractional));
magnitude_db_FO_calc = 20 * log10(abs(H_FO));
magnitude_db_SO_calc = 20 * log10(abs(H_SO));
phase_deg_fractional = angle(H_fractional) * 180/pi;
phase_deg_FO_calc = angle(H_FO) * 180/pi;
phase_deg_SO_calc = angle(H_SO) * 180/pi;

subplot(2,1,1); %[output:27b4e498]
semilogx(w_design, magnitude_db_fractional, 'k-', 'LineWidth', 2, 'DisplayName', 'Fractional (Ideal)'); %[output:27b4e498]
hold on; %[output:27b4e498]
semilogx(w_design, magnitude_db_FO_calc, 'b--', 'LineWidth', 1.5, 'DisplayName', 'FO Approx'); %[output:27b4e498]
semilogx(w_design, magnitude_db_SO_calc, 'r-.', 'LineWidth', 1.5, 'DisplayName', 'SO Approx'); %[output:27b4e498]
line([wc wc], ylim, 'Color', 'g', 'LineStyle', '--', 'DisplayName', 'ω_c'); %[output:27b4e498]
hold off; %[output:27b4e498]
grid on; %[output:27b4e498]
ylabel('Magnitude (dB)'); %[output:27b4e498]
title(sprintf('Filter Frequency Response: α = %.2f, ω_c = %.2f rad/s', alpha, wc)); %[output:27b4e498]
legend('Location', 'best'); %[output:27b4e498]

subplot(2,1,2); %[output:27b4e498]
semilogx(w_design, phase_deg_fractional, 'k-', 'LineWidth', 2); %[output:27b4e498]
hold on; %[output:27b4e498]
semilogx(w_design, phase_deg_FO_calc, 'b--', 'LineWidth', 1.5); %[output:27b4e498]
semilogx(w_design, phase_deg_SO_calc, 'r-.', 'LineWidth', 1.5); %[output:27b4e498]
hold off; %[output:27b4e498]
grid on; %[output:27b4e498]
ylabel('Phase (degrees)'); %[output:27b4e498]
xlabel('Frequency (rad/s)'); %[output:27b4e498]

%% Run PLL Simulation for Each Filter

% Preallocate storage
results = struct();
filter_names = {'FO', 'SO'};
filter_nums = {num_FO_z, num_SO_z};
filter_dens = {den_FO_z, den_SO_z};

for f_idx = 1:length(filter_names)
    filter_name = filter_names{f_idx};
    num_z = filter_nums{f_idx};
    den_z = filter_dens{f_idx};
    
    % Initialize PLL variables
    vco_phase = 0;
    vco_out = zeros(size(t));
    phase_error = zeros(size(t));
    filter_out = zeros(size(t));
    pd_output = zeros(size(t));
    
    % Initialize filter states
    zi = zeros(max(length(num_z), length(den_z))-1, 1);
    
    % PLL Loop
    for i = 1:length(t)
        % Phase detector (multiplier type)
        pd_output(i) = noisy_input(i) * vco_out(i);
        
        % Loop filter
        [filter_out(i), zi] = filter(num_z, den_z, pd_output(i), zi);
        
        % VCO
        vco_freq = f_vco_free + Kv * filter_out(i);
        vco_phase = vco_phase + 2*pi*vco_freq*dt;
        
        % Generate VCO output for next iteration
        if i < length(t)
            vco_out(i+1) = sin(vco_phase);
        end
    end
    
    % Store results
    results.(filter_name).vco_out = vco_out;
    results.(filter_name).filter_out = filter_out;
    results.(filter_name).pd_output = pd_output;
    results.(filter_name).phase_error = phase_error;
end

%% Plot PLL Results
figure('Position', [100, 100, 1400, 1000]); %[output:8ce5e09b]

% Plot for FO filter
subplot(2,2,1); %[output:8ce5e09b]
idx = t <= 0.2;
plot(t(idx), input_signal(idx), 'k', 'LineWidth', 1.5); %[output:8ce5e09b]
hold on; %[output:8ce5e09b]
plot(t(idx), noisy_input(idx), 'Color', [0.7 0.7 0.7], 'LineWidth', 0.5); %[output:8ce5e09b]
plot(t(idx), results.FO.vco_out(idx), 'b', 'LineWidth', 1.5); %[output:8ce5e09b]
hold off; %[output:8ce5e09b]
xlabel('Time (s)'); %[output:8ce5e09b]
ylabel('Amplitude'); %[output:8ce5e09b]
title('FO Filter: Input vs Output (First 0.2s)'); %[output:8ce5e09b]
legend('Clean Input', 'Noisy Input', 'VCO Output'); %[output:8ce5e09b]
grid on; %[output:8ce5e09b]

subplot(2,2,2); %[output:8ce5e09b]
idx = t <= 0.2;
plot(t(idx), input_signal(idx), 'k', 'LineWidth', 1.5); %[output:8ce5e09b]
hold on; %[output:8ce5e09b]
plot(t(idx), noisy_input(idx), 'Color', [0.7 0.7 0.7], 'LineWidth', 0.5); %[output:8ce5e09b]
plot(t(idx), results.SO.vco_out(idx), 'r', 'LineWidth', 1.5); %[output:8ce5e09b]
hold off; %[output:8ce5e09b]
xlabel('Time (s)'); %[output:8ce5e09b]
ylabel('Amplitude'); %[output:8ce5e09b]
title('SO Filter: Input vs Output (First 0.2s)'); %[output:8ce5e09b]
legend('Clean Input', 'Noisy Input', 'VCO Output'); %[output:8ce5e09b]
grid on; %[output:8ce5e09b]

% Full signal comparison
subplot(2,2,3); %[output:8ce5e09b]
plot(t, input_signal, 'k', 'LineWidth', 1); %[output:8ce5e09b]
hold on; %[output:8ce5e09b]
plot(t, results.FO.vco_out, 'b--', 'LineWidth', 1); %[output:8ce5e09b]
hold off; %[output:8ce5e09b]
xlabel('Time (s)'); %[output:8ce5e09b]
ylabel('Amplitude'); %[output:8ce5e09b]
title('FO Filter: Full Signal'); %[output:8ce5e09b]
legend('Input', 'VCO Output'); %[output:8ce5e09b]
grid on; %[output:8ce5e09b]

subplot(2,2,4); %[output:8ce5e09b]
plot(t, input_signal, 'k', 'LineWidth', 1); %[output:8ce5e09b]
hold on; %[output:8ce5e09b]
plot(t, results.SO.vco_out, 'r--', 'LineWidth', 1); %[output:8ce5e09b]
hold off; %[output:8ce5e09b]
xlabel('Time (s)'); %[output:8ce5e09b]
ylabel('Amplitude'); %[output:8ce5e09b]
title('SO Filter: Full Signal'); %[output:8ce5e09b]
legend('Input', 'VCO Output'); %[output:8ce5e09b]
grid on; %[output:8ce5e09b]



%% Calculate Performance Metrics
fprintf('\n=== PLL Performance Analysis ===\n'); %[output:9b1fb7c1]
for f_idx = 1:length(filter_names) %[output:group:87edf538]
    filter_name = filter_names{f_idx};
    
    % Lock detection
    lock_threshold = 0.1;
    filter_final = mean(results.(filter_name).filter_out(end-100:end));
    locked_idx = find(abs(results.(filter_name).filter_out - filter_final) < lock_threshold, 1);
    
    fprintf('\n%s Filter:\n', filter_name); %[output:5e683107] %[output:08e01c1a]
    if ~isempty(locked_idx)
        fprintf('  Lock time: %.4f seconds\n', t(locked_idx)); %[output:98b2a626] %[output:845a8cfd]
    else
        fprintf('  Did not lock\n');
    end
    
    % Frequency error
    final_vco_freq = f_vco_free + Kv * filter_final;
    freq_error = abs(final_vco_freq - f_input);
    fprintf('  Frequency error: %.4f Hz\n', freq_error); %[output:633e4f91] %[output:94cfd389]
    

end %[output:group:87edf538]

